const loginPageStyle = theme =>({
  root: {
    flexGrow: 1,
    marginTop: "4em"
  },
  paper: {
    padding: theme.spacing.unit * 2,
    textAlign: 'center',
    color: theme.palette.text.primary,
    maxWidth: "500px",
    margin: "auto"
  },
  button: {
    width: "50%",
    margin: "auto"
  }
});


export default loginPageStyle;
